import React, {Component} from "react"

class AboutComponent extends Component{
  render(){
    return(
      <div style={{display:"grid", gridTemplateColumns:"100vw", gridTemplateRows:"50px, 200px, 50px, 200px, 50px, auto"}}>
        <p className="text-24pt" style={{gridRow:"1 / span 1"}}>Our Story</p>
        <p className="text-16pt" style={{gridRow:"2 / span 1"}}>

        </p>
        <p className="text-24pt" style={{gridRow:"3 / span 1"}}>Mission Statement</p>
        <p className="text-16pt" style={{gridRow:"4 / span 1"}}>

        </p>
        <p className="text-24pt" style={{gridRow:"5 / span 1"}}>Awards and Accolades</p>
        <div style={{gridRow:"6 / span 1"}}>
        </div>
      </div>
    )
  }
}

export default AboutComponent;
